import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FaCar, FaMapMarkerAlt, FaLocationArrow } from "react-icons/fa";

function Home() {
  const navigate = useNavigate();
  const [pickup, setPickup] = useState("");
  const [drop, setDrop] = useState("");

  return (
    <div style={styles.container}>
      {/* Header */}
      <div style={styles.header}>
        <h1 style={styles.logo}>üõ∫ RIDE</h1>
      </div>

      {/* Main Content */}
      <div style={styles.content}>
        <h2 style={styles.title}>Where can we take you?</h2>
        
        {/* Location Inputs */}
        <div style={styles.inputContainer}>
          <div style={styles.inputWrapper}>
            <FaMapMarkerAlt style={{...styles.icon, color: '#4CAF50'}} />
            <input
              style={styles.input}
              placeholder="Enter pickup location"
              value={pickup}
              onChange={(e) => setPickup(e.target.value)}
            />
          </div>
          
          <div style={styles.inputWrapper}>
            <FaLocationArrow style={{...styles.icon, color: '#f44336'}} />
            <input
              style={styles.input}
              placeholder="Enter drop location"
              value={drop}
              onChange={(e) => setDrop(e.target.value)}
            />
          </div>
        </div>

        {/* Search Button */}
        <button 
          style={styles.searchButton}
          onClick={() => navigate("/map")}
          disabled={!pickup || !drop}
        >
          <FaCar style={{marginRight: '10px'}} />
          SEARCH OLA CABS
        </button>

        {/* Recent Rides */}
        <div style={styles.recentRides}>
          <h3>Recent Rides</h3>
          <div style={styles.rideItem}>
            <p>üè† Home to Office</p>
            <small>‚Çπ250 ‚Ä¢ 20 min ago</small>
          </div>
          <div style={styles.rideItem}>
            <p>üõí Mall to Home</p>
            <small>‚Çπ180 ‚Ä¢ 2 hours ago</small>
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
    fontFamily: 'Arial, sans-serif'
  },
  header: {
    padding: '20px',
    background: 'rgba(255,255,255,0.1)',
    backdropFilter: 'blur(10px)'
  },
  logo: {
    color: 'white',
    margin: 0,
    fontSize: '2rem'
  },
  content: {
    maxWidth: '500px',
    margin: '0 auto',
    padding: '40px 20px'
  },
  title: {
    color: 'white',
    fontSize: '1.8rem',
    marginBottom: '30px'
  },
  inputContainer: {
    background: 'white',
    borderRadius: '15px',
    padding: '20px',
    boxShadow: '0 10px 40px rgba(0,0,0,0.1)'
  },
  inputWrapper: {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '15px',
    borderBottom: '1px solid #eee',
    padding: '5px'
  },
  icon: {
    fontSize: '1.2rem',
    marginRight: '10px'
  },
  input: {
    flex: 1,
    padding: '12px',
    border: 'none',
    outline: 'none',
    fontSize: '1rem'
  },
  searchButton: {
    width: '100%',
    padding: '18px',
    marginTop: '20px',
    background: '#4CAF50',
    color: 'white',
    border: 'none',
    borderRadius: '50px',
    fontSize: '1.2rem',
    fontWeight: 'bold',
    cursor: 'pointer',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    transition: 'transform 0.2s',
    boxShadow: '0 5px 20px rgba(76, 175, 80, 0.4)'
  },
  recentRides: {
    marginTop: '40px',
    background: 'white',
    borderRadius: '15px',
    padding: '20px'
  },
  rideItem: {
    padding: '10px',
    borderBottom: '1px solid #eee',
    cursor: 'pointer'
  }
};

export default Home;
